import React, { useState } from 'react';
import { render } from 'react-dom';
import './style.css';
import {Simples, Composto, Main} from './convJuros.js';

function Ola(){
  return(

  <div>
  <h1>Conversor de Juros</h1>
  <br />
  <Simples/>
  <br />
  <hr />
  <br />
  <Composto/>
  <br />
  </div>
  );
}

function message(){
  render(Ola);
 }

export default function Home() {

  return (
    <div>
        <header>
          <div class="container" />
          <div id="logo">
            <img src="logo.png" alt="texto" height="400" width="400" />
          </div>
        </header>
        <div class="containerCentro1">
          <div class="containerCentro2">
            <div id="menu">
              <button class="button" onClick={message}>
                Conversor de Juros
              </button>
              <button class="button">Conversor de Juros Compostos</button>
            </div>
          </div>
        </div>
        <div id="principal">

          <div class="efeito">

            <div class="container">

            </div>
          </div>
        </div>
        <footer>Desenvolvido por Lucas Marinho</footer>
    </div>
  )
}

render(<Home />, document.getElementById('root'));
